window.bookSummaryJSON = "<p><b>An end of the world. The start of a new one. A thousand places to be.</b> </p> <p>Artorian has survived his encounter at the Ziggurat, but at a sharp cost. However, the powers in the world are moving and there is no time to rest. Even if Artorian doesnâ€™t realize his part in it, the next stage of the great plan is set in motion. </p> <p>In a place of mountains and dales, the old scholar must seek new information in order to puzzle out the last pieces and gather victory with his own two hands. For his loved ones, his humanity may need to be left behind. Yet, becoming something else is a small price to pay for an old man on a mission. Life comes at a price, but success comes with Ascension. </p> <p>War and Moonfall loom on the horizon. It matters little. Artorian will build his arsenal.</p>"; 
